import Header from "../components/Header.js";
export default function Solutions() {
  return (
    <div>
      <Header/>
      <div className="container-fluid">
        <div className="container">
          <h3 className="subTitle whiteTxt">THE GOAL</h3>
        </div>
      </div>
    </div>
  );
}
